import React, { useState } from 'react';
import axios from 'axios';
import './App.css';

const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:5000';

function App() {
  const [rating, setRating] = useState(0);
  const [review, setReview] = useState('');
  const [loading, setLoading] = useState(false);
  const [response, setResponse] = useState(null);
  const [error, setError] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    if (rating === 0) {
      setError('Please select a rating');
      return;
    }
    
    if (!review.trim()) {
      setError('Please write a review');
      return;
    }

    setLoading(true);
    setError(null);
    setResponse(null);

    try {
      const result = await axios.post(`${API_URL}/api/submit`, {
        rating,
        review: review.trim()
      });

      if (result.data.success) {
        setResponse(result.data.message);
        setRating(0);
        setReview('');
      }
    } catch (err) {
      setError(err.response?.data?.error || 'Failed to submit review. Please try again.');
    } finally {
      setLoading(false);
    }
  };

  const StarRating = () => {
    return (
      <div className="star-rating">
        {[1, 2, 3, 4, 5].map((star) => (
          <button
            key={star}
            type="button"
            className={`star ${rating >= star ? 'active' : ''}`}
            onClick={() => setRating(star)}
            disabled={loading}
          >
            ★
          </button>
        ))}
      </div>
    );
  };

  return (
    <div className="app">
      <header className="header">
        <div className="container">
          <h1 className="logo">FYND</h1>
          <p className="tagline">Share Your Experience</p>
        </div>
      </header>

      <main className="main">
        <div className="container">
          <div className="review-card">
            <h2>Rate Your Experience</h2>
            
            <form onSubmit={handleSubmit}>
              <div className="form-group">
                <label>How would you rate us?</label>
                <StarRating />
                {rating > 0 && (
                  <p className="rating-text">
                    You selected {rating} star{rating !== 1 ? 's' : ''}
                  </p>
                )}
              </div>

              <div className="form-group">
                <label htmlFor="review">Tell us about your experience</label>
                <textarea
                  id="review"
                  value={review}
                  onChange={(e) => setReview(e.target.value)}
                  placeholder="Share your thoughts..."
                  rows="5"
                  disabled={loading}
                  maxLength="1000"
                />
                <span className="char-count">{review.length}/1000</span>
              </div>

              <button
                type="submit"
                className="submit-btn"
                disabled={loading || rating === 0 || !review.trim()}
              >
                {loading ? 'Submitting...' : 'Submit Review'}
              </button>
            </form>

            {error && (
              <div className="alert alert-error">
                <span className="alert-icon">⚠️</span>
                {error}
              </div>
            )}

            {response && (
              <div className="alert alert-success">
                <span className="alert-icon">✓</span>
                <div>
                  <strong>Thank you for your feedback!</strong>
                  <p>{response}</p>
                </div>
              </div>
            )}
          </div>
        </div>
      </main>

      <footer className="footer">
        <div className="container">
          <p>© 2024 Fynd. All rights reserved.</p>
        </div>
      </footer>
    </div>
  );
}

export default App;
